import React from 'react';

const TableComponent = ({ data }) => {
  // Check if data is defined and not null
  if (!data) {
    return <div>Loading...</div>;
  }

  return (
    <table className="table table-striped">
      <thead>
        <tr>
          <th>Position</th>
          <th>Team</th>
          <th>Points</th>
          <th>Games Won</th>
          <th>Games Lost</th>
          <th>Goals For</th>
          <th>Goals Against</th>
          <th>Goal Difference</th>
        </tr>
      </thead>
      <tbody>
        {Object.values(data).map((team) => (
          <tr key={team.id}>
            <td>{team.position}</td>
            <td>
              <img src={team.team_crest} alt={`${team.name} crest`} style={{ width: '20px', marginRight: '10px' }} />
              {team.name}
            </td>
            <td>{team.points}</td>
            <td>{team.games_won}</td>
            <td>{team.games_lost}</td>
            <td>{team.goals_for}</td>
            <td>{team.goals_against}</td>
            <td>{team.goal_difference}</td>
          </tr>
        ))}
      </tbody>
    </table>
  );
};

export default TableComponent;
